import { useState } from "react";

import AdminH from "./AdminH";
import React from "react";
import AdSidebar from "./AdSidebar";

function Dashboard() {
    const [toggle, setToggle] = useState(true)
    const Toggle = () => {
        setToggle(!toggle)
    }
     const [ordert,setordert]=useState()
    useEffect(()=>{
        fetch('/skapi/totalordercount').then((result)=>{return result.json()}).then((data)=>{
          console.log(data)
           if(data.status==200){
             setordert(data.total_count)
             
              
           }
        })
      },[ordert])
    return (
        <>
        
            <div className='container-fluid bg-primary min-vh-100 '>
           
                <div className='row '>
                    {toggle && <div className='col-4 col-md-2  vh-100  bg-white' >
                    <AdSidebar/>
                        </div>}            
                    {toggle && <div className='col-1'></div>}
                    <div className='col'> 
                    <AdminH Toggle={Toggle} />     
                    </div>
                    </div>    
                    </div>
        </>
    );
}

export default Dashboard;
